    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        Log.i(TAG, "ononUpgrade");
        Log.i("Upgrade", "oldv1: " + oldVersion + " newv: " + newVersion);
        if (oldVersion <= 2 && newVersion >= 2){
            Log.i("Upgrade", "oldv1: " + oldVersion + " newv2: " + newVersion);
            actualiza_2(db);
        }
        if (oldVersion <= 2 && newVersion >= 3){
            Log.i("Upgrade", "oldv2: " + oldVersion + " newv3: " + newVersion);
            actualiza_v3(db);
        }
        if (oldVersion <= 3 && newVersion >= 4){
            Log.i("Upgrade", "oldv3: " + oldVersion + " newv4: " + newVersion);
            actualiza_v4(db);
        }
        if (oldVersion <= 4 && newVersion >= 5){
            Log.i("Upgrade", "oldv4: " + oldVersion + " newv5: " + newVersion);
            actualiza_v5(db);
        }
        if (oldVersion <= 5 && newVersion >= 6){
            Log.i("Upgrade", "oldv5: " + oldVersion + " newv6: " + newVersion);
            actualiza_v6(db);
        }
        if (oldVersion <= 6 && newVersion >= 7) {
            Log.i("Upgrade", "oldv6: " + oldVersion + " newv7: " + newVersion);
            actualiza_v7(db);
        }
        if (oldVersion <= 7 && newVersion >= 8) {
            Log.i("Upgrade", "oldv7: " + oldVersion + " newv8: " + newVersion);
            actualiza_v8(db);
        }
    }

